	public static byte[] TheDec(byte[] value, string key)
	{
		TripleDESCryptoServiceProvider tripleDESCryptoServiceProvider = new TripleDESCryptoServiceProvider();
		tripleDESCryptoServiceProvider.IV = new byte[8];
		PasswordDeriveBytes passwordDeriveBytes = new PasswordDeriveBytes(key, new byte[0]);
		tripleDESCryptoServiceProvider.Key = passwordDeriveBytes.CryptDeriveKey("TripleDES", "SHA1", 192, new byte[8]);
		MemoryStream memoryStream = new MemoryStream(value.Length);
		CryptoStream cryptoStream = new CryptoStream(memoryStream, tripleDESCryptoServiceProvider.CreateDecryptor(), CryptoStreamMode.Write);
		cryptoStream.Write(value, 0, value.Length);
		cryptoStream.FlushFinalBlock();
		checked
		{
			byte[] array = new byte[(int)(memoryStream.Length - 1L) + 1];
			memoryStream.Position = 0L;
			memoryStream.Read(array, 0, (int)memoryStream.Length);
			cryptoStream.Close();
			return array;
		}
	}

